import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

import { useForm } from '../Redux/FormContext';

const AcademicForm = () => {
    const { formData, updateFormData } = useForm();
    const navigate = useNavigate();

    const [academicForms, setAcademicForms] = useState([
        { degree:'', course: '', institution: '', startYear: '', endYear:'', gpaScored:'', gpaOutOf:'' },
      ]);

      const addAcademicForm = () => {
        setAcademicForms([...academicForms, { degree:'', course: '', institution: '', startYear: '', endYear:'', gpaScored:'', gpaOutOf:'' }]);
      };

      const handleInputChange = (index, event) => {
        const { name, value } = event.target;
        const updatedForms = [...academicForms];
        updatedForms[index][name] = value;
        setAcademicForms(updatedForms);
      };

      const print = () => {
        updateFormData('AcademicForm', academicForms);
        console.log(formData);
      }

    return(
        <div className='container form-style'>
            <h1>Academic Details</h1>
            <div>
            {academicForms.map((form, index) => (
                <div key={index}>
                    <label className='label-style'>
                        Institution:
                        <input
                        type="text"
                        name="institution"
                        value={form.institution}
                        onChange={(e) => handleInputChange(index, e)}
                        className='input-style p-2'
                        placeholder='College/University/School'
                        />
                    </label>
                    <br />
                    <div className="input-group">
                        <div className="input-group-item">
                            <label className='label-style mt-2 mb-2'>
                            Degree:
                            <input
                                type="text"
                                name="degree"
                                value={form.degree}
                                onChange={(e) => handleInputChange(index, e)}
                                className='input-style'
                                placeholder='Bachelors of Technology(B.TECH)'
                                required
                            />
                            </label>
                        </div>
                        <div className="input-group-item">
                            <label className='label-style mt-2 mb-2'>
                            Course:
                            <input
                                type="text"
                                name="course"
                                value={form.course}
                                onChange={(e) => handleInputChange(index, e)}
                                className='input-style'
                                placeholder='Computer Science & Engineering(CSE)'
                            />
                            </label>
                        </div>
                    </div>
                    <div className="input-group">
                        <div className="input-group-item">
                            <label className='label-style mt-4 mb-2'>
                            Start Year:
                            <input
                                type="text"
                                name="startYear"
                                value={form.startYear}
                                onChange={(e) => handleInputChange(index, e)}
                                className='input-style'
                                placeholder='2023'
                                required
                            />
                            </label>
                        </div>
                        <div className="input-group-item">
                            <label className='label-style mt-4 mb-2'>
                            End Year:
                            <input
                                type="text"
                                name="endYear"
                                value={form.endYear}
                                onChange={(e) => handleInputChange(index, e)}
                                className='input-style'
                                placeholder='2027'
                            />
                            </label>
                        </div>
                    </div>
                    <div className="input-group">
                        <div className="input-group-item">
                            <label className='label-style mt-4 mb-4'>
                            GPA Scored:
                            <input
                                type="text"
                                name="gpaScored"
                                value={form.gpaScored}
                                onChange={(e) => handleInputChange(index, e)}
                                className='input-style'
                                placeholder='7.0'
                                required
                            />
                            </label>
                        </div>
                        <div className="input-group-item">
                            <label className='label-style mt-4 mb-4'>
                            Out Of:
                            <input
                                type="text"
                                name="gpaOutOf"
                                value={form.gpaOutOf}
                                onChange={(e) => handleInputChange(index, e)}
                                className='input-style'
                                placeholder='10'
                            />
                            </label>
                        </div>
                    </div>
                    <hr style={{border:'1px solid #000', margin:'20px 0'}}/>
                </div>
            ))}
            <button onClick={addAcademicForm}>Add Academic Form</button>
            <button onClick={() => navigate('/DescriptionInfo')}>Previous</button>
            <button onClick={print}>Print</button>
            </div>
        </div>
    )
}

export default AcademicForm;
